import React, { useState } from "react";

type Message = {
  role: "teacher" | "student" | "system";
  text: string;
};

export default function ChatApp() {
  const [messages, setMessages] = useState<Message[]>([]);
  const [input, setInput] = useState("");
  const [sessionId, setSessionId] = useState<string | null>(null);

  // -----------------------------
  //  Core Send / Command Logic
  // -----------------------------
  const send = async () => {
    if (!input.trim()) return;

    // handle /commands
    if (input.startsWith("/")) {
      await handleCommand(input);
      setInput("");
      return;
    }

    try {
      const res = await fetch(
        `http://127.0.0.1:8000/chat?prompt=${encodeURIComponent(input)}${
          sessionId ? `&session_id=${sessionId}` : ""
        }`,
        { method: "POST" }
      );

      if (!res.ok) {
        const errText = await res.text();
        setMessages((p) => [...p, { role: "system", text: `❌ Server error: ${errText}` }]);
        return;
      }

      const data = await res.json();
      setSessionId(data.session_id || sessionId);

      setMessages((p) => [
        ...p,
        { role: "teacher", text: input },
        { role: "student", text: data.response },
      ]);

      setInput("");
    } catch (err) {
      console.error(err);
      setMessages((p) => [...p, { role: "system", text: "⚠️ Connection error." }]);
    }
  };

  // -----------------------------
  //  Handle /topic, /session, /search
  // -----------------------------
  const handleCommand = async (cmd: string) => {
    if (cmd.startsWith("/session")) {
      const res = await fetch("http://127.0.0.1:8000/session", { method: "POST" });
      const data = await res.json();
      setSessionId(data.session_id);
      setMessages((p) => [...p, { role: "system", text: data.message }]);
    } else if (cmd.startsWith("/topic")) {
      const topic = cmd.split(" ")[1] || "general";
      const res = await fetch(`http://127.0.0.1:8000/topic?new_topic=${topic}`, { method: "POST" });
      const data = await res.json();
      setMessages((p) => [...p, { role: "system", text: data.message }]);
    } else if (cmd.startsWith("/search")) {
      const query = cmd.split(" ").slice(1).join(" ");
      const res = await fetch(`http://127.0.0.1:8000/search?query=${encodeURIComponent(query)}`);
      const data = await res.json();
      const results =
        data.results?.results?.map((r: any) => `🔍 ${r.memory}`).join("\n") || "No results.";
      setMessages((p) => [...p, { role: "system", text: results }]);
    } else {
      setMessages((p) => [...p, { role: "system", text: "Unknown command." }]);
    }
  };

  // -----------------------------
  //  UI
  // -----------------------------
  return (
    <div className="flex flex-col items-center min-h-screen bg-gray-100 py-6">
      <div className="w-full max-w-2xl bg-white rounded-xl shadow-md p-4 flex flex-col">
        <div className="flex justify-between items-center mb-2">
          <h1 className="text-xl font-semibold text-blue-700">AI Learner</h1>
          <button
            onClick={() => {
              setMessages([]);
              setSessionId(null);
            }}
            className="text-sm bg-gray-200 hover:bg-gray-300 px-3 py-1 rounded"
          >
            🆕 New Chat
          </button>
        </div>

        {/* Chat Bubbles */}
        <div className="flex flex-col h-[32rem] border rounded-lg p-3 bg-gray-50 overflow-y-auto space-y-2">
          {messages.map((m, i) => (
            <div key={i} className={`flex ${m.role === "teacher" ? "justify-end" : "justify-start"}`}>
              <div
                className={`px-3 py-2 rounded-2xl max-w-[75%] shadow-sm whitespace-pre-line ${
                  m.role === "teacher"
                    ? "bg-blue-500 text-white rounded-br-none"
                    : m.role === "student"
                    ? "bg-green-100 text-gray-900 rounded-bl-none"
                    : "bg-gray-200 text-gray-600 text-center w-full"
                }`}
              >
                {m.text}
              </div>
            </div>
          ))}
        </div>

        {/* Input Bar */}
        <div className="flex mt-3">
          <input
            className="flex-1 border p-2 rounded-l-lg focus:outline-none focus:ring-2 focus:ring-blue-400"
            value={input}
            placeholder="Type a message or /command (e.g. /topic paneer)"
            onChange={(e) => setInput(e.target.value)}
            onKeyDown={(e) => e.key === "Enter" && send()}
          />
          <button
            className="bg-blue-600 hover:bg-blue-700 text-white px-5 py-2 rounded-r-lg transition"
            onClick={send}
          >
            Send
          </button>
        </div>
      </div>
    </div>
  );
}
